class Solution(object):
    def lengthOfLongestSubstring(self, string):
        """
        :type string: str
        :rtype: int
        """
        start_index = longest = 0
        diary = {}

        for curr_index, letter in enumerate(string, 1):
            if letter in diary and start_index < diary[letter]:
                start_index = diary[letter]
            else:
                longest = max(longest, curr_index - start_index)
            diary[letter] = curr_index

        return longest


class TestlengthOfLongestSubstring:

    def test_double_sign(self):
        assert Solution().lengthOfLongestSubstring("au") == 2

    def test_single_sign(self):
        assert Solution().lengthOfLongestSubstring(" ") == 1

    def test_empty_string(self):
        assert Solution().lengthOfLongestSubstring("") == 0

    def test_1(self):
        assert Solution().lengthOfLongestSubstring("abcabcbb") == 3

    def test_2(self):
        assert Solution().lengthOfLongestSubstring("bbbbb") == 1

    def test_3(self):
        assert Solution().lengthOfLongestSubstring("pwwkew") == 3

    def test_4(self):
        assert Solution().lengthOfLongestSubstring("dvdf") == 3

    def test_5(self):
        assert Solution().lengthOfLongestSubstring("kdgjkjhglfp") == 7

